import React from 'react';
import './HomeMedia.css';

const HomeMedia = () => {
    return (
        <div className="home-media">
            <div className="media-item media-item1">
                <img src="https://media.giphy.com/media/xT0GqvDCZfX8SjmT3G/giphy.gif?cid=790b76113wt3h1l2tczeum0v49au3xrmn4hfcuhf2zsz7hy5&ep=v1_gifs_search&rid=giphy.gif&ct=g" />
            </div>
            <div className="media-item media-item2">
                <img src="https://media.giphy.com/media/v1.Y2lkPTc5MGI3NjExM3d0M2gxbDJ0Y3pldW0wdjQ5YXUzeHJtbjRoZmN1aGYyenN6N2h5NSZlcD12MV9naWZzX3NlYXJjaCZjdD1n/3oKIPgT2Ib3pAUbYM8/giphy.gif" />
            </div>
            <div className="media-item media-item3">
                <img src="https://media.giphy.com/media/Dym2LTuxGJJSw/giphy.gif?cid=790b7611m1a3wtgstyxta7gzqxq78trv2bvdphqmfojiv7ne&ep=v1_gifs_search&rid=giphy.gif&ct=g" />
            </div>
        </div >
    );
}

export default HomeMedia;
